const AboutUs = () => {
   return (
      <div className="AboutUs">
         <div className="container">
            <h2
               className="pageTitle"
               style={{ backgroundColor: "lightblue", fontFamily: "Georgia" }}
            >
               About Us
            </h2>
         </div>
         <header className="aboutUsHeader">AboutUs</header>
      </div>
   );
};

export default AboutUs;
